import React from 'react';

const Img1 = () => {
  return (
    <div className="relative w-64 h-64 flex justify-center items-center mx-auto bg-black">
      {/* Fiecare cerc păstrează culoarea sa distinctă când nu se suprapune */}
      <div className="absolute w-32 h-32  rounded-full mix-blend-screen" style={{backgroundColor:'rgb(255,0,0'}}></div>
      <div className="absolute w-32 h-32  rounded-full mix-blend-screen" style={{ transform: 'translateX(70%)', backgroundColor:'rgba(0,255,0)' }}></div>
      <div className="absolute w-32 h-32 rounded-full mix-blend-screen" style={{ transform: 'translateY(50%)', backgroundColor:'rgba(0,0,255)' }}></div>
    </div>
  );
};

export default Img1;
